import React, { useState} from 'react';
import styled, { createGlobalStyle, ThemeProvider } from 'styled-components';
import ExpenditureTemplate from './component/ExpenditureTemplate';
import ExpenditureHead from './component/ExpenditureHead';
import ExpenditureFilter from './component/ExpenditureFilter';
import ExpenditureList from './component/ExpenditureList';
import ExpenditureCreate from './component/ExpenditureCreate';
import Dialog from './component/Dialog'

// import styled from 'styled-components';
// import './App.css';
// const AppBlock = styled.div`
//   width: 512px;
//   margin: 0 auto;
//   margin-top: 4rem;
//   border: 1px solid black;
//   padding: 1rem;
// `

const palette = {
  blue: '#4c6ef5',
  gray: '#495057',
  pink: '#e64980',
  yellow: '#ffec99',
  lime: '#d8f5a2',
  orange:'#ffd8a8',
  purple: '#eebefa',
}

const GlobalStyle = createGlobalStyle`
  body {
    background: #e9ecef;
  }
`

function App() {
  const [dialog, setDialog] = useState(false);
  const onClick = () => {
    setDialog(true);
  }
  return (
    <>
    <ThemeProvider theme={{palette}}>
      <GlobalStyle />
      <ExpenditureTemplate>
        <ExpenditureHead></ExpenditureHead>
        <ExpenditureFilter></ExpenditureFilter>
        <ExpenditureList></ExpenditureList>
        <ExpenditureCreate onClick={dialog? onClick : ''}></ExpenditureCreate>
        <Dialog title="지출 등록" confirmText="등록" cancelText="취소">
        </Dialog>
      </ExpenditureTemplate>
    </ThemeProvider>
    </>
  );
}

export default App;
